- input: "TEXT\x1CC00435834\x1C.TEXT\x1C\x1CF3N\x1C1) This committee utilizes Aristotle
    software to maintain its campaign records. This treasurer spoke with technical
    support to verify that a live update would make sure the latest forms were avaible
    for filing.  A live update was  performed before attempting to upload the report
    prior to midnight on April 15th and the report failed to upload or be accepted
    by the FEC software.  Consequently, the entire report was re-input into the FEC
    software in order to be able to upload.  It is not know what the cause of the
    error was.  2) An expenditure was made by this Committee for the benefit of Hultgren
    for Senate and the expenditure was reported as being paid directly to the company
    Reliant under the transfers to other committees; 3) An amount of $2716.96 was
    owed to William Cadigan for legal fees, of which it was agreed that one half or
    $1358.48 would be considered as a contribution.  The agreed upon paymen of$1358.48
    was credited first towards the outstanding debt due to Mr. Cadigan and the remaining
    203.48 in outstanding debt was considered an in kind contribution and reflected
    as such on this return. 4) payments from Friends for Lauzen were for the rental
    of the Committee's signs, equipment, supplies and mailing lists, which is allowable
    under the winding down activities of this committee.\n"
